import './App.css';
import ParentComponent from './DataBinding/ParentComponent';
import PropsDemoComponent from './DataBinding/PropCCDemo';
import CountDemo from './DataBinding/DemoStateEventCount';
import DemoEventSecond from './DataBinding/DemoEventSecond';

function App() {
  return (
    <div className="App">
      <ParentComponent/>
      <PropsDemoComponent techno="React" module="Data Binding"/>
      <CountDemo/>
      <DemoEventSecond/>
    </div>
  );
}

export default App;
